import Todo from "./Todo"

const TodoList = ({todos}) => {
  return (
    <div className='todo-list'>
      <Todo todo_list='todo 1'/>
      <Todo todo_list='todo 2'/>
      <Todo todo_list='todo 3'/>
    </div>
  )
}

export default TodoList;
